O PRESENTE ACORDO TEM POR OBJETIVO ESTABELECER COOPERAÇÃO TÉCNICA ENTRE O TRIBUNAL E O INSTITUTO NATURA VIDA, RESPEITADAS AS COMPETÊNCIAS E AS ATRIBUIÇÕES PRÓPRIAS DE CADA PARTE, VISANDO:
I - A IMPLANTAÇÃO DE NO MÍNIMO UM POSTO DE COLETA DE RESÍDUOS ELETROELETRÔNICOS NO TRIBUNAL;
II - A CONJUGAÇÃO DE ESFORÇOS E RECURSOS NA BUSCA DE SOLUÇÕES PARA A COLETA, TRATAMENTO E DESTINAÇÃO CORRETA DE RESÍDUOS ELETROELETRÔNICOS, COM VISTAS À PRESERVAÇÃO DO MEIO AMBIENTE E AO CUMPRIMENTO DA LEGISLAÇÃO AMBIENTAL;
III - A SENSIBILIZAÇÃO DA COMUNIDADE INTERNA SOBRE A IMPORTÂNCIA DA DESTINAÇÃO CORRETA DESTE TIPO DE MATERIAL;
IV - A PROMOÇÃO DO INTERCÂMBIO DE EXPERIÊNCIAS, INFORMAÇÕES, PESQUISAS, TECNOLOGIAS E SOLUÇÕES DE SUSTENTABILIDADE AMBIENTAL;
V - A REALIZAÇÃO DE AÇÕES INTEGRADAS DE INTERESSE RECÍPROCO ENTRE AS PARTES SIGNATÁRIAS;
VI - A DIFUSÃO DE BOAS PRÁTICAS DE EDUCAÇÃO AMBIENTAL REALIZADAS PELOS ÓRGÃOS PARTÍCIPES, OBSERVADA A POLÍTICA DE COMUNICAÇÃO DE CADA ÓRGÃO; VISANDO A CORRETA DESTINAÇÃO DO LIXO ELETRÔNICO.

O OBJETO DO PRESENTE INSTRUMENTO É A DISPONIBILIZAÇÃO, PARA OS ITENS DO TERMO DE REFERÊNCIA, DOS SEGUINTES BENS EM REGIME DE COMODATO, CONFORME AS EXIGÊNCIAS DESCRITAS NO TERMO DE REFERÊNCIA:
DEVERÁ SER CEDIDO PELA EMPRESA VENCEDORA AO HUAC/UFCG, DURANTE A VIGÊNCIA DO CONTRATO, EM REGIME DE COMODATO, UM EQUIPAMENTO NOVO, EM LINHA DE PRODUÇÃO, COM CERTIFICADO DE PRIMEIRA INSTALAÇÃO;
O EQUIPAMENTO CEDIDO DEVERÁ SER NOVO COM CERTIFICADO DE PRIMEIRA INSTALAÇÃO, COM COMPUTADOR E IMPRESSORA INCORPORADA AO SISTEMA;
O EQUIPAMENTO CEDIDO EM COMODATO DEVERÁ CONTER OU APRESENTAR AS SEGUINTES CARACTERÍSTICAS / COMPONENTES:
DISPONIBILIZAÇÃO DOS RESULTADOS EM ATÉ 18 HORAS;
A DETERMINAÇÃO DEVERÁ SER FEITA UTILIZANDO A METODOLOGIA DE LEITURA CINÉTICA;
O KIT DEVERÁ ACOMPANHAR TODOS OS INSUMOS E ACESSÓRIOS NECESSÁRIOS PARA EXECUÇÃO DOS TESTES COM PREVISÃO DE CONSUMO DE ATÉ 320 TESTES/MÊS, SENDO 160 DE IDENTIFICAÇÃO MICROBIANA E 160 DE SUSCEPTIBILIDADE MICROBIANA;
A EMPRESA VENCEDORA DEVERÁ FORNECER TAMBÉM PLACAS DE PEDTRI, COM OS SEGUINTES MEIOS DE CULTURA E QUANTIDADES MENSAIS: AGAR SANGUE ( 150 PLACAS/MÊS, AGAR CLED ( 100 PLACAS/MÊS), AGAR CHOCOLATE ( 50 PLACAS/MÊS), AGAR MACCONKEY (200 PLACAS /MÊS), MEIO CROMOGENICO ESBL (50 PLACAS MÊS), MEIO CROMOGENICO VRE (50 PLACAS/MÊS), MEIO CROMOGÊNICO MRSA (30 PLACAS/MÊS), MEIO CROMOGENICO PARA CANDIDA ( 100 PLACAS/MÊS);
CAPACIDADE DE REALIZAR, NO MÍNIMO, 60(SESSENTA) ANÁLISES MICROBIOLÓGICAS SIMULTANEAMENTE DE IDENTIFICAÇÃO E ANTIBIOGRAMA COM CONCENTRAÇÃO INIBITÓRIA MÍNIMA.
DEVERÁ UTILIZAR SISTEMA DE CARTÕES, COM PROVAS BIOQUÍMICAS MINIATURIZADAS COM, NO MÍNIMO, 25 PROVAS PRA IDENTIFICAÇÃO MICROBIANA;
O EQUIPAMENTO DEVERÁ APRESENTAR LEITURA CINÉTICA E, PREENCHIMENTO E SELAGEM DOS CARTÕES Á VÁCUO, AUTOMATICAMENTE;
O SISTEMA DEVERÁ SER TOTALMENTE AUTOMATIZADO, CAPAZ DE ASPIRAR, INCUBAR E REALIZAR A LEITURA DAS PROVAS;
CAPACIDADE DE DETECÇÃO DE, NO MÍNIMO, 300 (TREZENTAS) ESPÉCIES, ENTRE GRAM-POSITIVAS, GRAM-NEGATIVAS, LEVEDURAS, NEISSERIA, HAEMOPHILLUS, ANAERÓBIOS, SALMONELA, SHIGUELLA E YERSINIA, SEM A NECESSIDADE DE UTILIZAÇÃO DE REAGENTES ADICIONAIS;
SOFTWARE QUE REALIZE A VALIDAÇÕES DOS RESULTADOS DO ANTIBIOGRAMA, PESQUISA DE RESULTADOS ANORMAIS, EVENTUAIS RESISTÊNCIAS INSUFICIENTEMENTE EXPRESSAS, A VERIFICAÇÃO DE COEFICIÊNCIA ANTIBIOGRAMA/GERME IDENTIFICADO, A DETECÇÃO DE FENÓTIPOS DE RESISTÊNCIA IMPOSSÍVEIS, E DETECÇÃO DA AUSÊNCIA DE UMA RESISTÊNCIA ASSOCIADA.
EQUIPAMENTO DEVE TER TECLADO ALFA NUMÉRICO OU NUMÉRICO PARA IDENTIFICAÇÃO DOS PACIENTES, E DISPONHA DE ENTRADA PARA LEITOR DE CÓDIGO DE BARRAS;
O EQUIPAMENTO DEVERÁ ACOMPANHAR MANUAL DE INSTRUÇÕES PARA MANUSEIO EM PORTUGUÊS;
TER CAPACIDADE DE FAZER “ BACKUP “;
O ANALISADOR DEVERÁ APRESENTAR CONDIÇÕES PARA INTERFACEAMENTO COM O PROGRAMA DE INFORMÁTICA DA ULACAP (UNIDADE DE LABORATÓRIOS DE ANÁLISES CLÍNICAS E ANATOMIA PATOLÓGICA), FICANDO A CARGO DA EMPRESA VENCEDORA REALIZAR ESSE INTERFACEAMENTO COM O RESPONSÁVEL PELO SISTEMA, NUM PRAZO MÁXIMO DE 15 (QUINZE) DIAS APÓS INSTALAÇÃO E TREINAMENTO DO EQUIPAMENTO, SEM ÔNUS PARA O HUAC;
CAPACIDADE DE IMPRESSÃO DE RESULTADOS POR PACIENTE SEM A NECESSIDADE DE INTERVENÇÃO HUMANA;
